from django.db import modelsfrom django.utils.translation import gettext_lazy as _class PythonTip(models.Model):    tweet_id = models.PositiveBigIntegerField(        verbose_name=_('Tweet ID'),        unique=True,    )    tweeted_by = models.ForeignKey(        'twee.PythonTipTweetUser',        verbose_name=_('Tweeted by'),        on_delete=models.DO_NOTHING,        related_name='tips'    )    tip = models.TextField()    hash_tags = models.ManyToManyField(        'twee.PythonTipHashTag',        related_name='tips',        blank=True    )    likes = models.PositiveIntegerField(        verbose_name=_('Number of Tweet likes'),        default=0    )    retweets = models.PositiveIntegerField(        verbose_name=_('Number of retweets'),        default=0    )    timestamp = models.DateTimeField()    published = models.BooleanField(        verbose_name=_('Published'),        default=True,        help_text=_('Is tweet published?')    )    def __str__(self):        return str(self.tweet_id)    class Meta:        verbose_name = _('Tip')        ordering = [            '-timestamp'        ]        get_latest_by = '-timestamp'